import React, { useState, useEffect } from 'react';
import axios from 'axios';

const GuestPage = () => {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        const fetchMovies = async () => {
            try {
                const response = await axios.get('http://localhost:8080/screenings/allScreeningTimesByMovies');
                console.log('Response from API:', response.data); // Debugging statement
                // Extract the movie names from the response data
                const movieNames = response.data.map(movie => movie.movieName);
                // Get the first 10 unique movie names
                const uniqueMovies = Array.from(new Set(movieNames)).slice(0, 10);
                console.log('Movies:', uniqueMovies); // Debugging statement
                setMovies(uniqueMovies);
            } catch (error) {
                console.error('Error fetching movies:', error);
            }
        };

        fetchMovies();
    }, []);

    return (
        <div>
            <h2>Top 10 Movies</h2>
            <ul>
                {/* Render the list of movie names */}
                {movies.length > 0 ? (
                    movies.map((movie, index) => (
                        <li key={index}>{movie}</li>
                    ))
                ) : (
                    <li>No movies found</li>
                )}
            </ul>
        </div>
    );
};

export default GuestPage;
